sap.ui.define(["sap/ui/test/opaQunit","../pages/app/AppList","../pages/app/ViewApp","../pages/app/EditApp","../pages/app_contacts/AddAppContact","../pages/app_contacts/EditAppContact","../pages/app_contacts/ViewAppContact","../pages/Common"],function(e){"use strict";QUnit.module("App Contact");e("Select a app",function(e,p,t){p.onTheAppListPage.iClearTheSearch();p.onTheAppListPage.iSearchFor(p.onTheAppListPage.getAppName());p.onTheAppListPage.iPressOnTheObjectAtPositionInTable(p.onTheAppListPage.getPageName(),"idTableApps",0);t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("Pressing edit app I should see the edit form",function(e,p,t){p.onTheViewAppPage.iPressOnEditApplication();t.onTheEditAppPage.iShouldSeeTheEditAppScreen()});e("Pressing add contact should show the new contact page",function(e,p,t){p.onTheEditAppPage.iPress(p.onTheEditAppPage.getPageName(),"idButtonAddContact");t.onTheAddAppContactPage.iShouldSeeTheAddScreen().iShouldSeeThePageTitle()});e("Creating a new record",function(e,p,t){p.onTheAddAppContactPage.iEnterSuggestionText(p.onTheAddAppContactPage.getPageName(),"idUser","Randy");p.onTheAddAppContactPage.iPressSave(p.onTheAddAppContactPage.getPageName());t.onTheEditAppPage.iShouldSeeTheEditAppScreen();p.onTheEditAppPage.iWaitUntilTheTableIsLoaded(p.onTheEditAppPage.getPageName(),"idTableContacts");t.onTheEditAppPage.theTableHasEntries(p.onTheEditAppPage.getPageName(),"idTableContacts")});e("I can view the new record",function(e,p,t){p.onTheEditAppPage.iPressCancel(p.onTheEditAppPage.getPageName());t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("I can close the view contact screen",function(e,p,t){t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("Pressing the Close View Application should show the application table",function(e,p,t){p.onTheViewAppPage.iPress(p.onTheViewAppPage.getPageName(),"idButtonCloseApp");t.onTheAppListPage.iShouldSeeTheControl(p.onTheAppListPage.getPageName(),"idTableApps")})});